import React from 'react';

class AddClients extends React.Component {
  render() {
    return(
      <form>
        <label htmlFor="email">
          e-mail
          <input type="email" id="email" name="email" onChange={ this.handleChange } />
        </label>
        <label htmlFor="senha">
          name
          <input type="password" id="senha" name="senha" onChange={ this.handleChange } />
        </label>
      </form>
    )
  }
}
